import React, { useState } from "react";

const defaultForm = {
  email: "",
  fullName: "",
  age: "",
  education: "",
  institute: "",
  program: "",
  experience: "",
  canadaInstitute: "",
  canadaProgram: "",
  coutry: "",
  goals: "",
  scoresListening: "",
  scoresReading: "",
  scoresSpeaking: "",
  scoresWriting: "",
  isPaidTutionFees: null,
  paidTutionAmount: "",
  isGic: null,
  paidGicAmout: "",
};

function InputField({label, value, onChange, type, name }) {

  const handleChange = (e) => {
    onChange(e, name)
  };

  return (
    <div>
      <label>{label}</label>
      <input value={value} type={type} onChange={handleChange}/>
    </div>
  );
}

function SelectField() {};


export default function Form() {
  const [form, setForm] = useState(defaultForm);





  return (
    <div>
      <form>
        <InputField name="email" type="email" value={form.email}/>
      </form>
    </div>
  );
}
